import BarChart from "../components/Charts/BarChart";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import { useIntl } from "react-intl";
import { Translate } from "../utils/utils";
const DashboardPage = () => {
	const intl = useIntl();
	return (
		<Grid container spacing={2} sx={{ m: 2 }}>
			<Grid item xs={12} sm={8} md={6} lg={6} component={Paper} elevation={6}>
				<BarChart
					text={intl.formatMessage({
						id: "bar.title",
					})}
					subtitle={`${intl.formatMessage({
						id: "bar.source",
					})} <a href="https://worldpopulationreview.com/world-cities" target="_blank">${intl.formatMessage(
						{
							id: "bar.worldLargestPopulation",
						}
					)}</a>`}
					yAxisTitle={intl.formatMessage({
						id: "bar.PopulationMillion",
					})}
					tooltip={`${intl.formatMessage({
						id: "bar.Population2021",
					})}<b>{point.y:.1f} ${intl.formatMessage({
						id: "millions",
					})} </b>`}
					DataName={intl.formatMessage({
						id: "Population",
					})}
				></BarChart>
			</Grid>
		</Grid>
	);
};

export default DashboardPage;
